import {  createRouter, createWebHistory } from "vue-router"
import wedMain from "./views/WebMain"
import member from "./views/Member"
import publica from "./views/Public"
const router = createRouter({
  history: createWebHistory(),
  routes:[
    {
      path: "/",
      name: "wedMain",
      component: wedMain,
    },
    {
      path: "/member",
      name: "member",
      component: member,
    },
    {
      path: "/public",
      name: "public",
      component: publica,
    },


    ]
})


export default router
